package PrototypePattern;/** * java实现原型模式相对简单 * java 提供 clone() 对象复制方法 * 实现 Cloneable 接口 * */public class PrototypePattern implements Cloneable{    private int type = 0;    private Param param = new Param(10, "maple");    public PrototypePattern(){        System.out.println("原型模式创建成功!");    }    @Override    protected Object clone() throws CloneNotSupportedException {        System.out.println("原生模式对象拷贝!");        return super.clone();    }    public int getType() {        return type;    }    public void setType(int type) {        this.type = type;    }    public Param getParam() {        return param;    }    public void setParam(Param param) {        this.param = param;    }}